import React from 'react';

const TextField = ({ value, error, disabled }) => {
  console.log(value);

  return (
    <div>
      {error && <label htmlFor="app-text-field">{error}</label>}
      <input type="text" value={value} disabled={disabled} />
    </div>
  );
};

export default TextField;
